import { getFiles } from "../services/fileServices"

const FilePage = () => {
  const [error, setError] = useState(null);
  const [files, setFiles] = useState(null);
  console.log(process.env.SERVER_NAME, "process.env.RE11ACT_APP_SERVER_NAME")

  useEffect(() => {
